import React from 'react';

const ManageUser = (props) => {
    return (
        <div className='manage-user-container'>
            <div className='title'>
                Manage User
            </div>
            <div className='users-content'>
                <div>
                    <button>Add new users</button>
                </div>
            </div>

        </div>
    );
}

export default ManageUser;
